import React from 'react';
import './_About.scss';

function About() {
  return (
      <div className="about">
        <h1>Про компанію СУЛТАН</h1>
        <p>
          Наша місія створювати комфортні та стильні простори, допомагаючи клієнтам наповнювати Будинки красою, затишком та змістом!
        </p>
      </div>
  );
}

export default About;
